function extractRssi(){

    var extractedRssi = []
    _.each(data, function(i){
        extractedRssi.push(i.rssi)
    })

    var groupedRssi = _.groupBy(extractedRssi)

    var resultRssi = []
    _.each(groupedRssi, function(i){
        var res = {
            'rssi' : i[0],
            'run' : i.length
        }
        resultRssi.push(res)
    })
    console.log(resultRssi)
}


